import GameTitle from '../assects/snl-logo.75a58625.png'
import Dice from '../DICEFUNCTIONS/dice'
// import GameBG from '../assects/jungle-cartoon-background.jpg'
// import Gameboard from '../GAMEBOARD/gameboard'
import './mainfunction.css'
export default function Mainfunction() {
  return (
    <div className='bodys'>

        <div className="gamearea">
          <div className="sidenav">
            <img id='gametitleid' src={GameTitle} alt="" />
            <div className="diesBUTTON">
              <Dice />
            </div>
          </div>

          
      </div>

    </div>
  )
}
